/* Trigger structure for table `f_eval_motivacional` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `SUM_F_EVAL_MOTIVACIONAL` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `SUM_F_EVAL_MOTIVACIONAL` BEFORE UPDATE ON `f_eval_motivacional` FOR EACH ROW BEGIN
    SET NEW.TOTAL_P = NEW.PROACTIVIDAD + NEW.CALIDAD_SERVICIO + NEW.COMPROMISO + NEW.VESTIMENTA;
END */$$


DELIMITER ;

/* Procedure structure for procedure `SP_F_EVALUACIONMOT` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_F_EVALUACIONMOT` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_F_EVALUACIONMOT`(IN P_MES INT, IN P_ID_CENTRO_MAC INT, IN P_ANIO INT, IN IDPERSONALREG INT)
BEGIN
    SELECT
	MP.IDPERSONAL,
	ME.IDENTIDAD,
        FEM.IDEEVAL_MOTIVACIONAL,
        MP.NUM_DOC,
        CONCAT(MP.APE_PAT, ' ', MP.APE_MAT, ' ', MP.NOMBRE) AS NOMBREU,
        IFNULL(CTA.CTTT, 0) AS CTTT,
        CTA.FECHA,
        ME.ABREV_ENTIDAD,
        FEM.PROACTIVIDAD, FEM.CALIDAD_SERVICIO, FEM.COMPROMISO, FEM.VESTIMENTA, FEM.TOTAL_P, FEM.IDPERSONA_REGISTRA
    FROM
        M_PERSONAL MP
    LEFT JOIN 
	(SELECT IDEEVAL_MOTIVACIONAL, IDPERSONAL, PROACTIVIDAD, CALIDAD_SERVICIO, COMPROMISO, VESTIMENTA, TOTAL_P, IDPERSONA_REGISTRA
	FROM F_EVAL_MOTIVACIONAL
	WHERE MES = P_MES
	AND AÑO = P_ANIO
	AND IDPERSONA_REGISTRA = IDPERSONALREG
	) FEM ON FEM.IDPERSONAL = MP.IDPERSONAL
    JOIN
        M_ENTIDAD ME ON ME.IDENTIDAD = MP.IDENTIDAD
    JOIN
        M_CENTRO_MAC MCM ON MCM.IDCENTRO_MAC = MP.IDMAC
    LEFT JOIN
        (SELECT
            NUM_DOC,
            FECHA,
            IFNULL(COUNT(*), 0) AS CTTT
        FROM
            M_ASISTENCIA
        GROUP BY
            NUM_DOC, FECHA
        ) CTA ON CTA.NUM_DOC = MP.NUM_DOC
    WHERE
        CTA.CTTT > 0
        AND MONTH(CTA.FECHA) = P_MES
        AND YEAR(CTA.FECHA) = P_ANIO
        AND MCM.IDCENTRO_MAC = P_ID_CENTRO_MAC
        AND NOT ME.IDENTIDAD = 17        
    GROUP BY
        MP.NUM_DOC;
END */$$
DELIMITER ;

