insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (17,'EMISIÓN Y ENTREGA DE PASAPORTE ELECTRÓNICO',NULL,1,1,'98.60','Requisitos Generales:\r\n1. Exhibición del recibo de pago al Banco de la Nación por el derecho de trámite, que consigne número de DNI del beneficiario. Indicar el número de recibo y fecha de pago.\r\n2. Exhibición del DNI del beneficiario en buen estado.\r\nEn el caso de menores de edad, adicionalmente se presentará:\r\n1. Exhibición del DNI del padre o madre peruano en buen estado.\r\n2. En caso del padre o madre extranjero, exhibición del Pasaporte o documento análogo con entrada legal al país, o Carné de Extranjería (con la Tasa Anual de Extranjería al día y Residencia). En caso de presentación por apoderado(a):\r\n1. Exhibición del DNI del apoderado en buen estado.\r\n2. En caso de apoderado extranjero, exhibición del Pasaporte o documento análogo o Carnet de Extranjería (con la Tasa Anual de Extranjería al día y Residencia vigente).\r\n3. Carta Poder con firma legalizada por el Consulado Peruano y certificada por el Ministerio de Relaciones Exteriores o con poder inscrito en Registros Públicos.\r\nNota: Una vez realizado el trámite para la obtención de pasaporte electrónico, el ciudadano tiene 60 días calendario para recoger dicho pasaporte, caso contrario, tendrá que realizar nuevamente el trámite, el cual implica un nuevo pago.\r\n-Con la finalidad de brindar una mejor atención a la ciudadanía, se ha implementado la atención de Emisión de Pasaportes Electrónicos previa cita, via WEB ingresando a www.mac.pe.\r\n- En el caso de perdida o robo de pasaporte, se debe presentar la declaración Jurada de anulación de pasaporte por motivo de perdida o robo.\r\n- Contar con la cita virtual para tramite de expedición de pasaporte electrónico ordinario.\r\n- Solo en situaciones especiales, debidamente acreditadas, se dispone el uso de equipos electrónicos móviles para la captura de datos.\r\n- En el caso de tener multa debe realizar el pago, salvo que la multa haya prescrito o tenga la correspondiente dispensa por no haber sufragado.','SI',1,NULL,'2023-11-13 20:36:31','2023-11-13 20:36:31');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (18,'ORIENTACION PARA EMISIÓN DE PASAPORTE POR EMERGENCIA',NULL,1,1,'GRATUITO','Requisitos Generales:\r\n1. Exhibición de la tarjeta de embarque de la aerolínea (boarding pass) o el boleto de viaje (entiéndase como tal al documento que acredita la compra del pasaje para vuelos), con los datos del ciudadano correctamente indicados.\r\n2. El boleto de viaje debe tener más de 48 horas de emitido.\r\n3. DNI vigente y en buen estado.\r\n4. Comprobante de pago.\r\n5. No contar con multas electorales.\r\nNota: La evaluación de los requisitos estará a cargo de los profesionales de la Superintendencia Nacional de Migraciones.','NO',1,NULL,'2023-11-13 20:37:12','2023-11-13 20:37:12');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (19,'REGISTRO DE DATOS BIOMETRICOS',NULL,1,1,'GRATUITO','Requisitos Generales:\r\n1. Presentar cita impresa o virtual.\r\n2. Exhibir documento de viaje CIP, DNI o Pasaporte.\r\nEn el caso de menores de edad, adicionalmente se presentara:\r\n1. PNA (Partida de nacimiento) y CIP/Pasaporte en caso cuente con ello.\r\nEn caso de presentación por apoderado(a):\r\n1. Exhibición del CIP, DNI o Pasaporte del apoderado en buen estado.\r\n2. Carta Poder con firma legalizada por el Consulado Peruano y certificada por el Ministerio de Relaciones Exteriores.\r\nNota:\r\n- Presentar vestimenta de color oscuro para la toma fotografica (evitar colores claros y encendidos).\r\n- Para la toma fotografica considerar maquillaje discreto y evitar accesorios(piercing, aretes, cadenas ,collares ,y sus derivados).','SI',1,NULL,'2023-11-13 20:38:27','2023-11-13 20:38:27');
