insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (39,'INSCRIPCIÓN AL RUC',NULL,1,1,'GRATUITO','1. Exhibir DNI vigente o carnet de extranjeria (*), en caso la dirección del domicilio fiscal sea la misma que figura en su DNI (**).\r\n2. Indicar correo electrónico y teléfono móvil.\r\n3. No tener deudas electorales pendientes de pago\r\nNota:\r\n- El trámite de inscripción en el RUC debe ser realizado de manera presencial por el titular, quien deberá exhibir su DNI; en caso lo realice un tercero autorizado, debe exhibir su DNI o documento de identidad (*), además deberá adjuntar una carta poder con firma legalizada Notarialmente o Autenticada por Fedatario de la SUNAT, en la que conste expresamente la autorización otorgada y presentar el Formulario 2119 (Inscripción), firmado por el Titular del RUC.\r\n- El titular no debe de registrar multas en las últimas votaciones electorales.\r\n- La SUNAT se reserva el derecho de verificar el domicilio fiscal declarado por el contribuyente.\r\n(*) En caso que el titular o tercero autorizado se identifique con un documento distinto al DNI debe, además de exhibir el documento, presentar una copia simple de este.\r\n(**) En caso que el domicilio fiscal sea distinto al que figura en el DNI, la persona deberá presentar, además del DNI, el original de cualquier documento privado o público en el que conste la dirección completa del domicilio fiscal(con el Distrito) que se declara (ejemplo: recibo de servicio público, estado de cuenta, recibo \r\nvirtual, contrato de alquiler , entre otros).','NO',1,NULL,'2023-11-16 14:45:49','2023-11-16 14:45:49');
