insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (81,'INSCRIPCIÓN DE UN ESTABLECIMIENTO DE HOSPEDAJE (D.S N° 001-2015-MINCETUR Y R.M. 005-2019-VIVIENDA)',NULL,1,1,'SIN CATEGORIZACIÓN: INSCRIPCIÓN GRATUITA  CON CATEGORIZACIÓN: PAGO DE ACUERDO A LA CATEGORÍA  SOLICITADA.','REQUISITOS MINIMOS:\r\n1.Solicitud dirigida al Gerente Regional de Comercio Exterior, Turismo y Artesanía. Lic. Saul Caipani Altamirano. \r\n2.Declaracion jurada-Anexo N° 1 (otorgado por GERCETUR). \r\n3.Ficha RUC. \r\n4.Copia de Licencia Municipalidad. \r\n5.Croquis de ubicación del establecimiento.','NO',1,'1.Solicitud dirigida al Gerente Regional de Comercio Exterior, Turismo y Artesanía. Lic. Saul Caipani Altamirano. \r\n2.Declaracion jurada-Anexo N° 1 (otorgado por GERCETUR). \r\n3.Ficha RUC. \r\n4.Copia de Licencia Municipalidad. \r\n5.Croquis de ubicación del establecimiento.','2023-11-16 16:02:20','2023-11-17 20:25:01');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (82,'INSCRIPCIÓN DE UNA AGENCIA DE VIAJES Y TURISMO - CANALES DIGITALES',NULL,1,1,'GRATUITO','-	Solicitud dirigida al Gerente Regional de Comercio Exterior, Turismo y Artesanía Li. Saul Caipani Altamirano. \r\n-	 Declaración Jurada — ANEXO N” 2 — (otorgado por la GERCETUR).  \r\n-	Ficha RUC/  \r\n-	Croquis de ubicación del establecimiento.','NO',1,'-	Solicitud dirigida al Gerente Regional de Comercio Exterior, Turismo y Artesanía Li. Saul Caipani Altamirano. \r\n-	 Declaración Jurada — ANEXO N” 2 — (otorgado por la GERCETUR).  \r\n-	Ficha RUC/  \r\n-	Croquis de ubicación del establecimiento.','2023-11-16 16:03:08','2023-11-17 20:26:32');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (83,'OBTENCIÓN DEL CERTIFICADO DE AUTORIZACIÓN TURISMO DE AVENTURA',NULL,1,1,'COPIA DE RECIBO DE PAGO POR DERECHO DE TRAMITE S/ 93.00 EN GERCETUR','1). Solicitud dirigida al Gerente Regional de GERCETUR Lic. Saul H. \r\nCaipani Altamirano. \r\n2). Constancia de Presentación de Declaración Jurada de cumplimiento \r\nde requisitos mínimos, de acuerdo a lo dispuesto en el Reglamento de \r\nAgencias de Viajes y turismo vigente. \r\n3). Relación de la o las modalidades de turismo de Aventura que pretende \r\nPrestar; así como los lugares donde se desarrollan. \r\n4). Relación de equipos para cada modalidad de Turismo de Aventura que \r\nPretende ofrecer, cumpliendo con lo establecido en el artículo 22 del \r\nPresente Reglamento. Cada equipo deberá contar con un código de \r\nIdentificación asignada por la Agencia de Viajes y Turismo. \r\n5). Relación del contenido del equipo de primeros auxilios, de acuerdo a \r\nLas especificaciones aprobadas por el Viceministerio de Turismo. \r\n6). Declaración jurada, de acuerdo al formato aprobado por el Viceministerio de Turismo del MINCETUR, mediante el cual se compromete a \r\nPrestar el servicio con personal especializado que cumplirá con las \r\nDisposiciones establecidas en el artículo 21 del presente Reglamento. \r\n7). Programa de Manejo de Riesgos y atención de Emergencias \r\n8). Programa de mantenimiento de Equipos. \r\n9). Manual Interno de Operaciones \r\n10). Copia de recibo de pago por derecho de tramite s/ 93.00 \r\n11). Se debe presentar los 9 anexos en orden correlativo y de acuerdo al \r\nFormato aprobado por el viceministro de Turismo y firmados por el \r\nRepresentante de la Agencia de Viajes.','NO',1,'1). Solicitud dirigida al Gerente Regional de GERCETUR Lic. Saul H. \r\nCaipani Altamirano. \r\n2). Constancia de Presentación de Declaración Jurada de cumplimiento \r\nde requisitos mínimos, de acuerdo a lo dispuesto en el Reglamento de \r\nAgencias de Viajes y turismo vigente. \r\n3). Relación de la o las modalidades de turismo de Aventura que pretende \r\nPrestar; así como los lugares donde se desarrollan. \r\n4). Relación de equipos para cada modalidad de Turismo de Aventura que \r\nPretende ofrecer, cumpliendo con lo establecido en el artículo 22 del \r\nPresente Reglamento. Cada equipo deberá contar con un código de \r\nIdentificación asignada por la Agencia de Viajes y Turismo. \r\n5). Relación del contenido del equipo de primeros auxilios, de acuerdo a \r\nLas especificaciones aprobadas por el Viceministerio de Turismo. \r\n6). Declaración jurada, de acuerdo al formato aprobado por el Viceministerio de Turismo del MINCETUR, mediante el cual se compromete a \r\nPrestar el servicio con personal especializado que cumplirá con las \r\nDisposiciones establecidas en el artículo 21 del presente Reglamento. \r\n7). Programa de Manejo de Riesgos y atención de Emergencias \r\n8). Programa de mantenimiento de Equipos. \r\n9). Manual Interno de Operaciones \r\n10). Copia de recibo de pago por derecho de tramite s/ 93.00 \r\n11). Se debe presentar los 9 anexos en orden correlativo y de acuerdo al \r\nFormato aprobado por el viceministro de Turismo y firmados por el \r\nRepresentante de la Agencia de Viajes.','2023-11-16 16:03:27','2023-11-17 20:27:09');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (84,'INSCRIPCIÓN DE UNA AGENCIA DE VIAJES Y TURISMO',NULL,1,1,'GRATUITO','Solicitud dirigida al Gerente Regional de Comercio Exterior Turismo y Artesanía\r\nDeclaración Jurada ANEXO N° 1 (Descargar)\r\nCopia de la ficha RUC\r\nCopia de la licencia Municipal\r\nCroquis de ubicación del establecimiento (CUANDO ES FUERA DEL CASCO MONUMENTAL)\r\n\r\nLocal de libre acceso al público para atender al turista y dedicado a prestar de manera exclusiva al servicio de agencia de viajes y turismo.\r\nIndependizada de los locales de negocios colindantes\r\nContar con equipo de computo\r\nConexión a internet y correo electrónico\r\nTeléfono\r\nEquipo de impresora y escáner\r\nEl personal que brinde atención directa al público acreditar experiencia mínima de un (01) año en actividades turísticas y que haya llevada por lo menos un curso de técnicas de atención al cliente, en ambos casos mediante certificado o constancia expedida por entidades públicas o privadas\r\nAcreditar formación académica superior a técnica productiva en materia de turismo, mediante de Grado o Titulo emitido por entidades públicas o privadas.\r\nEl personal calificado que se dedique a brindar atención directa al turista, debe estar identificado señalando su nombre y cargo, mediante la placa u otro medio que permita su fácil identificación por los turistas.','NO',1,NULL,'2023-11-16 16:03:47','2023-11-16 16:04:19');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (85,'INSCRIPCION O MODIFICACION EN EL REGISTRO NACIONAL DEL ARTESANO PARA ARTESANOS',NULL,1,1,'GRATUITO','Si  eres persona natural debes tener DNI                                                                                                                                                                                                                                                                                   Si representas a una empresa artesanal, debes verificar que el objeto\r\nsocial de la personería jurídica debe decir que se dedica a la\r\nproducción de artesanía.\r\nSi representas una asociación de artesanos, debes verificar la\r\nvigencia de poder de la última junta directiva inscrita en registros\r\npúblicos.\r\nSi representas a una cooperativa artesanal, verificar que el objeto\r\nsocial de la personería jurídica debe decir que se dedica a la\r\nproducción de artesanía.\r\nSi representas a una institución privada de desarrollo vinculada con el\r\nsector artesanal, debes verificar que el objeto social debe ser de\r\ndesarrollo de proyectos, capacitaciones o actividades de artesanía.\r\nCorreo electrónico.','NO',1,NULL,'2023-11-16 16:04:34','2023-11-16 16:04:34');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (86,'INSCRIPCION PARA ESTABLECIMINETOS DE RESTAURANTE CATEGORIZADOS  (1 A 5 TENEDORES) D.S.011-2019-MINCETUR',NULL,1,1,'PAGO DE ACUERDO A LA CATEGORIZACIÓN SOLICITADA.','-	D.5.011-2019-MINCETUR \r\n-	Solicitud dirigida al Gerente Regional de Comercio Exterior y Turismo \r\n-	ASUNTO: Solicito Clasificación como Restaurante categoría de ..... tenedor) \r\n-	Anexo de acuerdo a la categoría solicitada \r\n-	Copia de la Ficha RUC \r\n-	Copia del Certificado Técnico de Seguridad en Edificaciones \r\n-	Recibo de Caja por derecho a trámite establecido en el TUPA. \r\n-	Registro fotográfico.','NO',1,'-	D.5.011-2019-MINCETUR \r\n-	Solicitud dirigida al Gerente Regional de Comercio Exterior y Turismo \r\n-	ASUNTO: Solicito Clasificación como Restaurante categoría de ..... tenedor) \r\n-	Anexo de acuerdo a la categoría solicitada \r\n-	Copia de la Ficha RUC \r\n-	Copia del Certificado Técnico de Seguridad en Edificaciones \r\n-	Recibo de Caja por derecho a trámite establecido en el TUPA. \r\n-	Registro fotográfico.','2023-11-16 16:04:52','2023-11-17 20:27:56');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (87,'CERTIFICADO DE ANTECEDENTES JUDICIALES',NULL,1,1,'37.70','A. En caso el trámite lo realice el titular:\r\n1. Comprobante de pago de derecho de trámite, en el que figure el número de DNI del solicitante.\r\n2. Presentar documento de Identidad (Original):\r\n- Nacionales: DNI.\r\n- Extranjeros: Pasaporte, carné de extranjería u otro documento de identidad otorgado al amparo de tratados internacionales.\r\nPara ciudadanos extranjeros con documento de identidad distinto a carnet de extranjería deberán llevar una foto actual tamaño carnet con fondo blanco para adjuntarla a su Certificado de Antecedentes Judiciales.\r\n3. Ser mayor de edad (18 años cumplidos). Nota:\r\n- El extranjero deberá tener Notificación de Migraciones  para sus trámites.\r\nB. Si el trámite lo hace un apoderado, deberá presentar los siguientes documentos:\r\n1. Comprobante de pago de derecho de trámite, en el que figure el número de DNI del solicitante.\r\n2. Copia del documento de identidad del poderdante.\r\n3. Documento de identidad original del apoderado.\r\n4. Una foto actual tamaño carnet con fondo blanco del poderdante (solo en los casos de usuario de nacionalidad extranjera)\r\n5. Carta poder  o legalizado: según corresponda se podrá presentar los siguientes documentos:\r\n- Carta Poder Simple: Caso de cónyuge, conviviente o parientes hasta el primer grado de consanguinidad (padres e hijos según Decreto Legislativo N° 1246).\r\n- Carta Poder Notarial: Este documento deberá contar necesariamente con la firma legalizada del Poderdante ante Notario Público (Validez de un año). Para el lugar donde no exista Notario, al apoderado presentará Carta Poder con firma legalizada por el Juez de Paz Letrado o Juez de Paz del lugar donde se encuentre el usuario.\r\n- Poder Otorgado en el extranjero: Si el poderdante se encuentra en el exterior deberá:\r\n* Tramitar el poder respectivo ante el Consulado del Perú (carta poder consular original y copia legalizada)\r\n* Copia del documento de identidad del solicitante\r\n* Una foto actual tamaño carnet del solicitante con fondo blanco\r\n* DNI original del apoderado\r\n* Tramitar Carta Poder ante el Notario Público u homólogo del país en el que reside y legalizarla ante el consulado del Perú.','NO',1,NULL,'2023-11-16 16:05:20','2023-11-16 16:05:20');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (88,'CERTIFICADO DE ANTECEDENTES PENALES',NULL,1,2,'52,8','Este documento se encuentra disponible para CIUDADANOS MAYORES DE EDAD , los cuales deberán presentar la\r\nsiguiente documentación :\r\nPara Trámite Personal:\r\n1. Comprobante de pago de S/ 52.80 por concepto de Certificado de Antecedentes Penales donde figure el  número\r\nde DNI del titular.\r\n\r\n2. Documenton de Identidad (original y será presentado al realizar el trámite)\r\n  - Ciudadano Peruano: Documento Nacional de Identidad (DNI).\r\n  - Ciudadano Extranjero: Pasaporte, Carné de Extranjería u otro documento de identidad otorgado al amparo de\r\ntratados internacionales.\r\nPara Trámite por Apoderado:\r\n1. Comprobante de pago de S/ 52.80 por concepto de Certificado de Antecedentes Penales donde figure el  número\r\nde DNI del titular.\r\n2. Poder otorgado ante Notario Público o Poder Consular (en caso de estar en e l extranjero debidamente visado enel Ministerio de Relaciones Exteriores.\r\n3. Documento de Identidad del Apoderado (en original y será presentado al momento de realizar el trámite\r\n   - Ciudadano Peruano: Documento Nacional de Identidad (DNI).\r\n   - Ciudadano Extranjero:  Documento Nacional de Identidad señalado en el Poder.\r\n      01 foto actual del poderdante tamaño pasaporte a colores en fondo blanco. Indicar generales de Ley\r\n      Fecha de nacimiento y nombre de los padres (solo si el poderdante es ciudadano extranjero)\r\nNota:  \r\n  - La foto del solicitante se obtiene de la base de datos de Reniec, o de lo contrario se toma de manera GRATUITA en\r\nla oficina donde se realiza el trámite.\r\nSolo será necesario presentar la foto tamaño pasaporte a colores en fondo blanco, si el trámite  se realiza a nombre de\r\nun ciudadano extranjero mediante Poder.\r\n - El certificado es válido para uso nacional y en el exterior (previa  legalización en el Ministerio de Relaciones\r\nExteriores), tiene una vigencia de 90 días contados desde su expedición.\r\n- Los trámites \"observados\", seran atendidos en un máximo de 30 minutos salvo los realizados fuera del horario laboral\r\ndel Poder Judicial  (L-V 8:00 a 16:45 Hrs) que serán atendidos al día siguiente hábil.','NO',1,NULL,'2023-11-16 16:05:49','2023-11-17 13:18:22');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (89,'CERTIFICADO DE HOMONIMIA',NULL,1,1,'10,8','Solicitud del Certificado de Homonimia R.A. 158-2016-GG-PJ\r\n1. El ciudadano que tenga conocimiento de la existencia de un posible caso de homonimia respecto a su persona podrá solicitar\r\nel Certificado de Homonimia al Registro Nacional de Requisitorias del Poder Judicial acompañando los documentos que\r\nacrediten su identidad personal, así como los demás que estime conveniente para acreditar su pedido.\r\n2 .Previo pago del derecho correspondiente y siguiendo los mismos pasos sobre poderes en aplicación de los ítems A, B, C y D\r\ndel primer párrafo, se atenderá la solicitud de expedición de certificado de homonimia. Si este no tiene observación (pendiente\r\nde descarte) se emitirá de forma inmediata. Si el descarte tardara más de media hora el personal del Mac se comunicará con\r\nlos analistas de descartes del Registro Nacional Judicial- RENAJU.','NO',1,NULL,'2023-11-16 16:06:08','2023-11-16 16:06:08');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (90,'CERTIFICADO DE DEUDOR ALIMENTICIO MOROSO',NULL,1,1,'10.30','A. En caso la consulta la realice el titular:\r\n1. Presentar DNI o Pasaporte, CE, PTP, CPP, Cédula de Identidad, Carné de Refugiado.\r\nB. Si el trámite lo hace un apoderado (Cónyuge del titular, Conviviente del titular o Parientes hasta el 1°\r\ngrado de consanguineidad), deberá presentar Carta poder simple.En caso de abogado debe presentar su carnet de colegiatura\r\nhabilitado.\r\n2 .Previo pago del derecho correspondiente y siguiendo los mismos pasos sobre poderes en aplicación de los ítems A, B, C y D\r\ndel primer párrafo, se atenderá la solicitud de expedición de certificado de Redam, la emisión es inmediata.','NO',1,NULL,'2023-11-16 16:06:29','2023-11-16 16:06:29');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (91,'ACREDITACIÓN COMPLEMENTARIA Y ACREDITACIÓN POR LATENCIA',NULL,1,1,'GRATUITO','ACREDITACION COMPLEMENTARIA                                                                               \r\n1. DNI, carnet de extranjería o Partida de Nacimiento.\r\n2. Si eres trabajador debe contar con 03 meses de aportaciones consecutivas o 04 no consecutivos dentro de los 06 meses calendarios anteriores al mes que se incio la contingencia.\r\n3. Si eres Pensionista de la ONP, presentar la Resolucion en tramite de pensionista,\r\n4. Si eres trabajador del hogar: debe contar con 03 meses de aportaciones consecutivas o 04 no consecutivos dentro de los 06 meses calendarios anteriores al mes que se incio la contingencia..\r\nLATENCIA : Debe contar con el cese laboral registrado por el empleador, en caso suspenssion perfecta de labores SPL debe contar con registro de Suspension perfecta en PLAME.','NO',1,NULL,'2023-11-16 16:06:51','2023-11-16 16:06:51');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (92,'ACTUALIZACIÓN Y MODIFICACIÓN DE DATOS DEL ASEGURADO TITULAR O DERECHOHABIENTES',NULL,1,1,'GRATUITO','1. Documento de Identidad del asegurado titular original (DNI, carnet de Extranjería o Pasaporte).\r\n2. Documento de Identidad del solicitante (DNI, carnet de Extranjería o Pasaporte) original.                                                                                                                 \r\n3. Llenar el formulario  1010.','NO',1,NULL,'2023-11-16 16:07:06','2023-11-16 16:07:06');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (93,'AFILIACIÓN AL SCTR INDEPENDIENTE - SEGURO COMPLEMENTARIO DE TRABAJO DE RIESGO',NULL,1,1,'GRATUITO','Para Trabajadores Independientes\r\n1. Formulario Nº 6004\r\n2. mostrar documento de identidad: DNI, Carnet de extranjería, de corresponder.','NO',1,NULL,'2023-11-16 16:07:21','2023-11-16 16:07:21');
