insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (95,'CAMBIO DE ADSCRIPCIÓN TEMPORAL DEL ASEGURADO TITULAR O DERECHOHABIENTES',NULL,1,1,'GRATUITO','Cambio de Adscripción Temporal (Desplazamiento temporal a una Provincia o Departamento por un periodo máximo de 6 meses en 1 año calendario). \r\nTitular: Presentar el Formulario F-1010 y CONSTANCIA DE DESPLAZAMIENTO TEMPORAL POR MOTIVOS LABORALES firmado por el titular, en caso de desplazamiento por motivos laborales.\r\nPara los demás casos de desplazamiento (motivos no laborales) presentar el Formulario F-1010, debidamente llenado y firmado por el afiliado titular.\r\nDerechohabiente: Presentar el Formulario F-1010 firmado por el afiliado titular, cónyuge, concubino(a), padre, madre, tutor o curador, según corresponda.','NO',1,NULL,'2023-11-16 16:08:04','2023-11-16 16:08:04');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (96,'REGISTRO DE BENEFICIARIOS AL SEGURO DE ACCIDENTES + VIDA',NULL,1,1,'5.00','Registro de Beneficiarios\r\nPara Asegurados Regulares e Independientes con un seguro en EsSalud - Formulario 6012 – Registro de beneficiarios +Vida','NO',1,NULL,'2023-11-16 16:08:27','2023-11-16 16:08:27');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (97,'REGISTRO DE INSCRIPCIÓN Y BAJA EXCEPCIONAL DE TITULAR Y DERECHOHABIENTES',NULL,1,1,'GRATUITO','Inscripción de Derechohabientes - Llenar formulario 1010 y Politicas de Privacidad.\r\n1. Cónyuge: En Perú: Copia simple del Acta o Partida de Matrimonio Civil, con una antigüedad no mayor de seis (06) meses. Extranjero:\r\nCopia simple del acta, con el sello de apostilla. \r\no partida de matrimonio que haya sido inscrita en el Registro de la oficina consular de Perú del lugar de celebración del acto o legalizada por el Consulado\r\nPeruano de su jurisdicción y por el Ministerio de Relaciones Exteriores e inscrito en la Municipalidad o RENIEC o que cuente con el sello de la Apostilla de La Haya.\r\n2. Concubino: Copia simple del documento de Reconocimiento de la Unión de Hecho, sea por Resolución Judicial o por Escritura Pública.\r\n3. Hijo Menor de Edad: Copia simple de la Partida o Acta de nacimiento del menor.\r\n4. Gestante: Copia simple de escritura de reconomiento de hijo extramatrimonial.(Notarialmente).\r\nBaja de Titular y/o Derechohabientes - Llenar formulario 1010\r\nPor fallecimiento en el país: Presentar Formulario 1010 debidamente llenado y\r\nfirmado por quien corresponda. Por fallecimiento en el extranjero: Copia simple de la partida de defunción o su equivalente, cuyo original se encuentre\r\nlegalizado por el consulado en el Perú del país donde falleció el  derecho habiente o cuente con el sello de la Apostilla de La Haya. Si el documento se encuentra redactado en idioma distinto al español, se requiere la traducción.         \r\nPor disolución del vínculo matrimonial en el país : Copia simple de la resolución judicial, resolución de alcaldía,\r\no de la escritura pública que declara disuelto el vínculo matrimonial.\r\nPor disolución del vínculo matrimonial en el extranjero: Copia simple de la resolución judicial de sentencia de divorcio expedida por el Tribunal extranjero y\r\nlegalizada por el Ministerio de Relaciones Exteriores o que cuente con el sello.','NO',1,NULL,'2023-11-16 16:08:48','2023-11-16 16:08:48');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (98,'ORIENTACIÓN DE ESTADO DEL ASEGURADO Y OTROS SERVICIOS',NULL,2,1,'GRATUITO','Presentar documento de Identidad (Original)','NO',1,NULL,'2023-11-16 16:09:07','2023-11-16 16:09:07');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (99,'CONSTANCIA DE VERIFICACIÓN DE DATOS DE AUTORIDADES',NULL,1,2,'GRATUITO','Para el trámite en línea, la solicitud se realiza en el link: https://enlinea.sunedu.gob.pe/.\r\nPara el trámite presencial, la solicitud se realiza en el módulo de la Sunedu. Para la emisión de la constancia de verificación de datos de autoridades, los datos del Secretario General que suscribió el documento, o quien haga sus veces, deben encontrarse previamente inscritos en la Base de Datos de Autoridades; caso contrario, los documentos deben ser autenticados por el Secretario General en funciones, o quien haga sus veces, que deberá encontrarse inscrito en la Base de Datos de Autoridades. Los usuarios, antes de solicitar la constancia, pueden verificar en el portal institucional de la Sunedu (https://enlinea.sunedu.gob.pe/) si los datos del Secretario General que suscribió el documento, o quien haga sus veces, se encuentran previamente inscritos en la Base de Datos de Autoridades. Los documentos emitidos por las universidades, escuelas de posgrado o instituciones y escuelas de educación superior autorizadas a otorgar grados y títulos de rango universitario, deben contar con los nombres y apellidos del titular del documento sujeto a verificación de datos. Los documentos emitidos por las universidades, escuelas de posgrado o instituciones y escuelas de educación superior deben contar con fecha de expedición, de certificación o de autenticación, según sea el caso.\r\n1) Diploma del grado o título (previamente inscrito en el Registro Nacional de Grados y Títulos);\r\n2) Diplomado de posgrado (se debe haber completado un mínimo de 24 créditos).\r\n3) Documentos de formación profesional provenientes de universidades, entregados en el marco de los programas de formación continua, que deben certificar nota aprobatoria.\r\n4) Certificados de estudios, sílabos, constancia de matrícula, malla curricular o plan de estudios, constancias y/o certificados que acrediten la condición del solicitante.\r\nPara el trámite en línea, la solicitud se realiza en el link: https://enlinea.sunedu.gob.pe/','NO',1,NULL,'2023-11-16 16:15:22','2023-11-16 16:15:22');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (100,'CONSTANCIA DE INSCRIPCIÓN  DE GRADOS Y TÍTULOS EN EL REGISTRO NACIONAL DE GRADOS Y TÍTULOS',NULL,1,2,'GRATUITO','Para el trámite en línea, la solicitud se realiza en el link: https://enlinea.sunedu.gob.pe/.\r\nPara el trámite presencial, la solicitud se realiza en el módulo de la Sunedu. Para la emisión de la constancia, los grados y títulos deberán estar previamente inscritos en el Registro Nacional de Grados y Títulos, a solicitud de las universidades, escuelas de posgrado o instituciones y escuelas de educación superior autorizadas a otorgar grados o títulos de rango universitario','NO',1,NULL,'2023-11-16 16:15:43','2023-11-16 16:15:43');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (101,'ORIENTACIÓN EN LOS SERVICIOS DE LA SUNADU',NULL,2,1,'GRATUITO','Servicio que consiste en brindar orientación a los ciudadanos sobre las funciones de la Sunedu, servicios ofrecidos; así como algunos alcances de la Ley N° 30220 – Ley Universitaria y demás normativa emitida por la Sunedu.','NO',1,NULL,'2023-11-16 16:16:01','2023-11-16 16:16:01');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (102,'AFILIACIÓN AL SIS EMPRENDEDOR',NULL,1,1,'GRATUITO','1. Presentar DNI o Carnet de Extranjeria Vigente\r\n2. No contar con otro seguro de salud.\r\n3. Contar con el pago tres meses consecutivos a la SUNAT en las categorías 1 o 2 del Nuevo RUS\r\n(NRUS)','NO',1,NULL,'2023-11-16 16:17:14','2023-11-16 16:17:14');
