insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (104,'AFILIACIÓN AL SIS INDEPENDIENTE',NULL,1,2,'MENOR DE 60 AÑOS: S/. 39.00 A PARTIR DE 60 AÑOS: S/. 58.00  * PAGO INDIVIDUAL  \'- TITULAR + 01 DERECHOHABIENTE: S/ 78.00 - TITULAR + 02 DERECHOHABIENTES: S/ 94.00 - TITULAR + 03 DERECHOHABIENTES: S/ 115.00 (PAGO FAMILIAR)','1. Presentar DNI o Carnet de Extranjeria Vigente\r\n2. No contar con otro seguro de salud.','NO',1,NULL,'2023-11-16 16:17:53','2023-11-16 16:17:53');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (105,'INFORMACIÓN SOBRE AFILIACIÓN  SOBRE AFILIACIÓN AL SIS MYPE',NULL,2,1,'EL PAGO ES DE S/ 15.00 MENSUALES POR CADA TRABAJADOR INSCRITO, SIN COSTO ADICIONAL POR DERECHOHABIENTES INSCRITOS MENORES DE 18 AÑOS Y MAYORES CON DISCAPACIDAD.','1. El trámite lo realiza exclusivamente el empleador\r\n2.Contar con una Clave de Sol\r\n3. Contar con un correo electrónico \r\n4. No contar con otro seguro de salud\r\n5. La empresa debe estar registrada en REMYPE\r\n6. Tener los DNIs o CE vigentes de los trabajadores y sus derechohabientes','NO',1,NULL,'2023-11-16 16:18:12','2023-11-16 16:18:12');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (106,'AFILIACIÓN AL SIS PARA TODOS',NULL,1,1,'GRATUITO','1. DNI o carnet de extranjeria\r\n2. No contar con ningun seguro activo','NO',1,NULL,'2023-11-16 16:18:29','2023-11-16 16:18:29');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (107,'AFILIACIÓN DE GESTANTE (POBLACIÓN DETERMINADA POR NORMA)',NULL,1,1,'GRATUITO','1. Presentar DNI o Carnet de Extranjeria Vigente ,\r\n2. No contar con otro seguro de salud\r\n3. Carné de control prenatal o cualquier documento en donde figura la fecha probable de parto\r\n\r\nEN CASO DE NO CONTAR CON DNI\r\n La gestante puede presentar su Acta de Nacimiento o un documento que las identifique como tal, el cual puede ser emitido por una institución o autoridad competente (Nacional y/o extranjera). En caso de no contar con ningún documento que lo identifique, debe presentar una Declaración Jurada conteniendo los datos de la persona, en caso de menores de edad, la Declaración Jurada de padres o tutor).','NO',1,NULL,'2023-11-16 16:18:49','2023-11-16 16:18:49');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (108,'AFILIACIÓN MENOR DE 5 AÑOS (POR NORMA)',NULL,1,1,'GRATUITO','1. Presentar, DNI o carnet de extranjeria vigente de los padres o tutores\r\n2. No contar con otro seguro de salud\r\n\r\nEN CASO DE NO CONTAR CON DNI\r\nLos menores de edad entre cero (0) a cinco (5) años, para la identificación pueden presentar el Acta de Nacimiento o Certificado de Nacido Vivo o Tarjeta de Control de Niño Sano o un documento que los identifique como tal, el cual puede ser emitido por una institución o autoridad competente (Nacional y/o extranjera). En caso de no contar con ningún documento que identifique al menor, deben presentar una Declaración Jurada de padres o tutor, conteniendo los datos del menor','NO',1,NULL,'2023-11-16 16:19:03','2023-11-16 16:19:03');
