insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (116,'CANJE DE LE A DNI',NULL,1,2,'GRATUITO','Requisitos Generales:\r\n1. Menores de 07 años deben presenta 01 Fotografía actualizada tamaño pasaporte a color con fondo blanco, sin retoques, sin lentes, sin prendas en la cabeza. \r\nMayores de 07 años las fotografías se toma mediante captura en vivo.\r\n2. Recibo de servicio público (luz, agua, cable, teléfono, arbitrios, etc.), en copia y original, con una antigüedad no mayor a 6 meses. Requisitos Específicos:\r\nA. Canje de Libreta Electoral a DNI:\r\nProcedimiento que deben realizar las personas mayores de edad cuyo último documento de identidad es la Libreta Electoral de ocho (08) dígitos y que aun no han tramitado su DNI.\r\n- Informe Médico Expedido por Autoridad Competente.','NO',1,NULL,'2023-11-16 16:22:41','2023-11-16 16:22:41');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (117,'DUPLICADO DE DNI (SOLO DNI AZUL)',NULL,1,2,'PARA MAYOR DE EDAD  (DNI AZUL): S/ 24.00 PERSONA CON DISCAPACIDAD GRATUITO','Requisitos Generales:\r\n1. Voucher de pago.\r\n2. En caso de menor de edad, el trámite debe realizarse por el último declarante del menor. Nota:\r\n* La vigencia del último DNI debe ser mayor a 60 días antes de su fecha de caducidad.\r\n* La fecha de caducidad del DNI no se modificará en el duplicado de DNI. Requisitos Específicos: - Personas con Discapacidad: A. Original y copia simple del Certificado de Discapacida','NO',1,NULL,'2023-11-16 16:22:59','2023-11-16 16:22:59');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (118,'RECTIFICACIÓN DE DATOS CON EMISIÓN DE DNI (NOMBRES, APELLIDOS, DOMICILIO, ESTADO CIVIL, CAMBIO EN LA DECISIÓN DE CEDER ÓRGANOS Y TEJIDOS)',NULL,1,2,'PARA MENOR DE EDAD (HASTA LOS 16 AÑOS): S/ 16.00 (NOMBRES, APELLIDOS Y DOMICILIO)','Requisitos Generales:\r\n1. Documento sustentatorio de la rectificación que se solicita.\r\n2. Voucher de pago.\r\n3. En caso de menor de edad, la rectificación debe realizarse por el declarante que realizó el último trámite del menor. \r\nNota: La vigencia del último DNI debe ser mayor a 60 días antes de su fecha de caducidad. Menor de Edad: El declarante debe exhibir su DNI. Requisitos Específicos:\r\n- Cambio en la decisión de ceder órganos y tejidos: Ninguno (Declarativo)\r\nA. Nombres y Apellidos:\r\n-Vía Judicial: Copia simple de la Resolución Judicial de la Rectificación.\r\n-Vía Notarial: Copia Certificada y copia simple de la Escritura Pública Rectificatoria.\r\n-Vía Administrativa: Copia Certificada y copia simple del expediente administrativo y Resolución Registral de la Rectificación.\r\nB. Domicilio: Recibo de servicio público (luz, agua, cable, teléfono, arbitrios, etc.) en original y copia, con una antigüedad no mayor a 6 meses.\r\nC. Estado Civil:\r\na. Casado: Declaración Jurada indicando esa condición según el formato de RENIEC o la Copia Certificada del Acta de Matrimonio.*\r\n- Mujeres casadas (apellido del esposo): Copia Certificada del Acta de Matrimonio Civil.\r\nb. Divorciado: Copia Certificada del Acta de Matrimonio expedida por el Registro del Estado Civil con la anotación marginal de la disolución del vínculo matrimonial.\r\nc. Viudo: Declaración Jurada de Matrimonio y copia certificada del Acta de Defunción del cónyuge, expedida por el Registro del Estado Civil.\r\nd. De Casado a Soltero:\r\n- Administrativamente: Resolución emitida por la Sub Gerencia de Depuración de Identificación, que resuelve rectificar el dato del estado civil.\r\n- Por Mandato Judicial: Oficio y parte con resolución judicial consentida o ejecutoriada que corresponda.\r\nNota:\r\n- Anulación de vínculo matrimonial: Copia Certificada del Acta de Matrimonio Civil donde conste la anotación de nulidad y la copia certificada y simple de la resolución judicial firme. En este caso se revierte el estado civil anterior.\r\n- Las personas bautizadas antes del 14 de noviembre de 1936 pueden realizar su rectificación con la partida de bautismo autenticada por el notario eclesiástico\".\r\n* No será necesario presentar la Copia Certificada del Acta de Matrimonio cuando ésta se encuentra en el Sistema de Registros Civiles del RENIEC.','NO',1,NULL,'2023-11-16 16:24:17','2023-11-16 16:24:17');
