insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (121,'RECTIFICACIÓN DE DATOS SIN EMISIÓN DE DNI (GRADO DE INSTRUCCIÓN, ESTATURA)',NULL,1,2,'ORDINARIO (CUALQUIER EDAD): S/ 16.00 PERSONAS CON DISCAPACIDAD GRATUITO','Requisitos Generales:\r\n1. Menores de 07 años deben presenta 01 Fotografía actualizada tamaño pasaporte a color con fondo blanco, sin retoques, sin lentes, sin prendas en la cabeza. \r\nMayores de 07 años las fotografías se toma mediante captura en vivo.\r\n2. Voucher de pago.\r\nRequisitos Específicos:\r\nA. Rectificación de situación de discapacidad: Para las personas que se encuentran registradas como discapacitadas y al haber cesado su situación de discapacidad desean retirar dicha condición de su inscripción:\r\n- Informe médico expedido por autoridad competente','NO',1,NULL,'2023-11-16 16:25:38','2023-11-16 16:25:38');
insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (122,'RECTIFICACIÓN DE DATOS CON EMISIÓN DE DNI (REGISTRO DE DISCAPACIDAD)',NULL,1,2,'GRATUITO','Requisitos Generales:\r\n1. Una Fotografía actualizadas tamaño pasaporte a color en fondo blanco, sin retoques , sin lentes, sin prendas en la cabeza excepto las religiosas.\r\nRequisitos Específicos:\r\nA. Registro de Discapacidad: Original y copia simple del Certificado de Discapacidad en el formato aprobado por el MINSA o de la Constancia Médica de Discapacidad, que señale la discapacidad (Física, Sensorial, Mental, Intelectual).\r\n* Nota:\r\n- Personas con Discapacidad mental o intelectual, que no puedan efectuar por si mismos el procedimiento: Exhibir el DNI de los padres o de uno de ellos, de los abuelos o de quien ejerza su cuidado.\r\n- Las personas con discapacidad, podrán efectuar el trámite de manera personal y directa u opcionalmente asistidos por quien ejerza su cuidado.\r\n- Sólo se consignará la condición de discapacidad del titular de la inscripción en el DNI o Padrón Electoral, a solicitud del interesado.','NO',1,NULL,'2023-11-16 16:26:51','2023-11-16 16:26:51');
