insert  into `d_entidad_servicios`(`IDSERVICIOS`,`NOMBRE_SERVICIO`,`TIPO_SER`,`TRAMITE`,`ORIENTACION`,`COSTO_SERV`,`REQUISITO_SERVICIO`,`REQ_CITA`,`FLAG`,`OBSERVACION`,`CREATED_AT`,`UPDATED_AT`) values (132,'QUIERO MI PENSIÓN',NULL,1,1,'GRATUITO','PENSION DE JUBILACIÓN: Documentos que acrediten la relación laboral o declaración jurada simple que compruebe el vínculo laboral. Estos pueden ser: Certificados de trabajo, Boletas de pago de remuneraciones, Liquidación de tiempo de servicios o de beneficios sociales, Constancias de aportaciones de la Oficina de Registro y Cuenta Individual Nacional de Empleadores Asegurados (Orcinea) emitido por el Instituto Peruano de Seguridad Social (IPSS) o del Seguro Social de Salud (EsSalud), cualquier documento público de acuerdo al artículo 235 del Código Procesal Civil, Copia simple de los Certificados de Pago Regular (CPR), Certificados de Pago Especial (CPE) u otros comprobantes de pago emitidos por el ex Instituto Peruano de Seguridad Social (IPSS) o EsSalud, siempre que dicha información no se encuentre en los sistemas que administra la ONP. Partida de matrimonio civil, part de nacimiento/ DNI de hijos menores.\r\n\r\nPENSION DE INVALIDEZ: Certificado Médico de Discapacidad emitido por el Seguro Social de Salud (EsSalud), establecimientos de salud pública del Minsa o Entidades Prestadoras de Salud, Documentos que acrediten la relación laboral o declaración jurada simple que compruebe el vínculo laboral. Estos pueden ser: Certificados de trabajo, Boletas de pago de remuneraciones, Liquidación de tiempo de servicios o de beneficios sociales, Constancias de aportaciones de la Oficina de Registro y Cuenta Individual Nacional de Empleadores Asegurados (Orcinea) emitido por el Instituto Peruano de Seguridad Social (IPSS) o del Seguro Social de Salud (EsSalud), cualquier documento público de acuerdo al artículo 235 del Código Procesal Civil, Copia simple de los Certificados de Pago Regular (CPR), Certificados de Pago Especial (CPE) 