ados (Orcinea) emitido por el Instituto Peruano de Seguridad Social (IPSS) o del Seguro Social de Salud (EsSalud), cualquier documento público de acuerdo al artículo 235 del Código Procesal Civil, Copia simple de los Certificados de Pago Regular (CPR), Certificados de Pago Especial (CPE) u otros comprobantes de pago emitidos por el ex Instituto Peruano de Seguridad Social (IPSS) o EsSalud, siempre que dicha información no se encuentre en los sistemas que administra la ONP, partida de matrimonio civil, part de nacimiento /DNI de hijos menores y otros según art. 235 del código procesal civil, partida de nacimiento/DNI, acta de defunción (opcional), Pensión de Orfandad - Estudios (adicional a los requisitos señalados para la Pensión de Orfandad - Menores de 18): Certificado o Constancia de Estudios, Matrícula, Ingreso o Reporte de Notas del correspondiente centro de estudios. Pensión de Orfandad - Discapacidad (adicional a los requisitos señalados para la Pensión de Orfandad - Menores de 18): Copia simple del Certificado Médico de Invalidez emitido por EsSalud, establecimientos de salud pública del Ministerio de Salud o Entidades Prestadoras de Salud.\r\n\r\nPENSIÓN DE ORFANDAD CP: Partida De Nacimiento/DNI, Acta De Defunción (opcional), Pensión de Orfandad - Estudios (adicional a los requisitos señalados para la Pensión de Orfandad - Menores de 18): Certificado o Constancia de Estudios, Matrícula, Ingreso o Reporte de Notas del correspondiente centro de estudios. Pensión de Orfandad - Discapacidad (adicional a los requisitos señalados para la Pensión de Orfandad - Menores de 18): Copia simple del Certificado Médico de Invalidez emitido por EsSalud, establecimientos de salud pública del Ministerio de Salud o Entidades Prestadoras de Salud.\r\n\r\nPENSIÓN DE ASCENDIENTE: Padre mayor de 60 y madre con 55 o más años de edad. Copia simple del Certificado Médico de discapacidad de corresponder. El certificado médico debe ser expedido por EsSalud, establecimientos de salud p